import React from "react";
import InnerServicesAreaItem from "./InnerServicesAreaItem";

const InnerServicesArea = () => {
  const inner_services = [
    {
      src: "/img/icon/inner_services_icon01.png",
      url: "/services-details",
      title: "Web Development",
      desc: "Crafting responsive and dynamic websites tailored to your needs.",
    },
    {
      src: "/img/icon/inner_services_icon02.png",
      url: "/services-details",
      title: "Mobile App Development",
      desc: "Building intuitive and feature-rich mobile applications for various platforms.",
    },
    {
      src: "/img/icon/inner_services_icon03.png",
      url: "/services-details",
      title: "UI/UX Design",
      desc: "Designing engaging and user-friendly interfaces for seamless user experiences.",
    },
    {
      src: "/img/icon/inner_services_icon04.png",
      url: "/services-details",
      title: "E-commerce Solutions",
      desc: "Creating scalable and secure e-commerce platforms to drive your online business.",
    },
    {
      src: "/img/icon/inner_services_icon05.png",
      url: "/services-details",
      title: "Digital Marketing",
      desc: "Executing strategic digital marketing campaigns to enhance your online presence.",
    },
    {
      src: "/img/icon/inner_services_icon06.png",
      url: "/services-details",
      title: "SEO Optimization",
      desc: "Optimizing websites to improve search engine rankings and drive organic traffic.",
    },
    {
      src: "/img/icon/inner_services_icon07.png",
      url: "/services-details",
      title: "Content Creation",
      desc: "Crafting compelling and relevant content to engage your target audience.",
    },
    {
      src: "/img/icon/inner_services_icon08.png",
      url: "/services-details",
      title: "Consulting Services",
      desc: "Providing expert guidance and advice to help you achieve your business goals.",
    },
  ];

  return (
    <section className="inner-services-area pt-110 pb-100">
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-6">
            <div className="section-title title-style-two text-center mb-60">
              <span className="sub-title">Digital Services</span>
              <h2 className="title">Transform Your Business Digitally</h2>
            </div>
          </div>
        </div>

        <div className="inner-services-item-wrap">
          <div className="row justify-content-center">
            {inner_services.map((service, index) => (
              <div key={index} className="col-xl-3 col-lg-4 col-md-6 col-sm-8">
                <InnerServicesAreaItem item={service} />
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default InnerServicesArea;
